import React from 'react';

import { tripDetails } from '../constants/TripDetailConstants';

const Carousel = ({ selected }) => {

    return(
        <div className="carousel-container">
            <div className="carousel-elements">
                {Object.keys(tripDetails).map((page, index) => {
                    return <svg viewBox="0 0 1 1" className="carousel-item">
                        <circle className="circle" cx=".5" cy=".5" r=".5" fill={page === selected ? "rgb(247, 243, 239)" : "rgb(30, 29, 30)"  }/>
                    </svg>
                })}  
           </div> 
        </div>
    )
}

export default Carousel;
